import React, { Component } from "react";
import SearchIcon from "./white-search-icon.jpg";
import "./NavBar.css";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <nav className="navbar">
        <div>
          <ul>
            {this.props.options.map(option => {
              return (
                <li className="navbar-option">
                  {option.title}
                  <div className="navbar-option-dot"></div>
                </li>
              );
            })}
          </ul>
        </div>
        <div>
          <img height="23" width="23" alt="search" src={SearchIcon}></img>
        </div>
      </nav>
    );
  }
}

export default Navbar;
